import React from 'react';
import './App.css';
import { Todolist } from './Components/Todolist';

let task1 = [
    { id: 1, title: "css", isDone: true },
    { id: 2, title: "js", isDone: false },
    { id: 3, title: "html", isDone: true }

]
let task2 = [
    { id: 1, title: "cofe", isDone: true },
    { id: 2, title: "breack", isDone: false },
    { id: 3, title: "car", isDone: false },


]

function App() {
    return (
        <div className="App">
            <Todolist title='React' task={task1} />
            <Todolist title='Html' task={task2} />
        </div >
    );
}

export default App;
